import React from 'react';
import '../css/Footer.css';

const Footer = () => {
  return (
    <div id="footer">
      <h3>
        تمامی حقوق مادی و معنوی این سایت متعلق به علیرضا سماعی یکتا می باشد
        ©2021
      </h3>
    </div>
  );
};

export default Footer;
